-- ----------------------------
-- Table structure for classes
-- ----------------------------
DROP TABLE IF EXISTS `classes`;
CREATE TABLE `classes` (
  `cid` int(11) NOT NULL auto_increment,
  `cname` varchar(20) collate utf8_unicode_ci NOT NULL,
  PRIMARY KEY  (`cid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for hb
-- ----------------------------
DROP TABLE IF EXISTS `hb`;
CREATE TABLE `hb` (
  `uid` int(11) NOT NULL,
  `uname` varchar(20) character set gbk NOT NULL,
  `upass` varchar(20) collate utf8_unicode_ci NOT NULL,
  PRIMARY KEY  (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for idcard
-- ----------------------------
DROP TABLE IF EXISTS `idcard`;
CREATE TABLE `idcard` (
  `id` int(11) NOT NULL auto_increment,
  `cardno` varchar(32) NOT NULL,
  `Person_ID` int(11) NOT NULL,
  PRIMARY KEY  (`id`),
  KEY `sdf` (`Person_ID`),
  CONSTRAINT `sdf` FOREIGN KEY (`Person_ID`) REFERENCES `person` (`personid`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk;

-- ----------------------------
-- Table structure for person
-- ----------------------------
DROP TABLE IF EXISTS `person`;
CREATE TABLE `person` (
  `personid` int(11) NOT NULL auto_increment,
  `PersonName` varchar(20) NOT NULL,
  `sex` int(11) NOT NULL,
  `age` int(11) NOT NULL,
  `birthday` varchar(50) NOT NULL,
  PRIMARY KEY  (`personid`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk;

-- ----------------------------
-- Table structure for photo
-- ----------------------------
DROP TABLE IF EXISTS `photo`;
CREATE TABLE `photo` (
  `pid` int(11) NOT NULL auto_increment,
  `pname` varchar(20) collate utf8_unicode_ci NOT NULL,
  `photo` blob,
  PRIMARY KEY  (`pid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for s_table
-- ----------------------------
DROP TABLE IF EXISTS `s_table`;
CREATE TABLE `s_table` (
  `sid` int(11) NOT NULL auto_increment,
  `sname` varchar(20) collate utf8_unicode_ci NOT NULL,
  PRIMARY KEY  (`sid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for stu
-- ----------------------------
DROP TABLE IF EXISTS `stu`;
CREATE TABLE `stu` (
  `sid` int(11) NOT NULL auto_increment,
  `sname` varchar(20) collate utf8_unicode_ci NOT NULL,
  `cid` int(11) NOT NULL,
  PRIMARY KEY  (`sid`),
  KEY `cs` (`cid`),
  CONSTRAINT `cs` FOREIGN KEY (`cid`) REFERENCES `classes` (`cid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for student
-- ----------------------------
DROP TABLE IF EXISTS `student`;
CREATE TABLE `student` (
  `studentid` int(11) NOT NULL auto_increment,
  `studentName` varchar(32) NOT NULL,
  PRIMARY KEY  (`studentid`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk;

-- ----------------------------
-- Table structure for t_table
-- ----------------------------
DROP TABLE IF EXISTS `t_table`;
CREATE TABLE `t_table` (
  `tid` int(11) NOT NULL auto_increment,
  `tname` varchar(20) collate utf8_unicode_ci NOT NULL,
  PRIMARY KEY  (`tid`),
  CONSTRAINT `id` FOREIGN KEY (`tid`) REFERENCES `s_table` (`sid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for teacher
